(1, 1, 'Donor darah di Kok Tong, Cemara Asri', 'Kegiatan Donor Darah dengan protokol kesehatan di Kedai Kopi Kok Tong, Cemara Asri, Medan Kota.', '<p><em>Ayo ..  Ikuti Baksos Donor Darah dengan </em><strong><em>Protokol Kesehatan</em></strong><em>. Bagi saudara/i yang ingin mengikuti Baksos Donor Darah Yayasan Hope.</em></p><p><br></p><p>Mohon konfirmasi terlebih dahulu ke <strong>No. Call Center kami di 0852 1143 3338</strong></p><p><br></p><p>Mohon bantuannya untuk share informasi penting ini ke teman, saudara, atau kerabat terdekat. </p><p><br></p><p><em><u>Banyak Nyawa Pasien yang dapat kita selamatkan.</u></em></p><p><br></p><p><strong>Lokasi: Kok Tong, Jl. Boulevard Raya No. 88E, Komp. Cemara Asri, Medan</strong></p><p><strong>Hari/Tanggal: Minggu, 29 November 2020</strong></p><p><strong>Waktu: 08.00 s/d 12.00 WIB</strong></p><p><br></p><p>Didukung oleh, PMI, Palang Merah Indonesia </p><p><br></p><p>Untuk donasi kegiatan tersebit dapat disalurkan ke rek:</p><p><strong>BCA </strong></p><p><strong>7865 9988 99</strong></p><p><strong>An. YAYASAN HOPE</strong></p><p><br></p><p>Terimakasih atas sumbangsinya, Sedikit donasi dan donor darah dapat menyelematkan pasien. </p><p><br></p><p>Salam pengabdian,</p><p>Yayasan HOPE</p>', '/images/event/120201121045947.jpg', '2020-11-21 02:59:47', '2020-11-21 03:39:02'),
