(4, 1, 'PENGGALANGAN DANA', 'Update terbaru mengenai Acek Akhun umur 61 thn, yang ditemukan di pinggir jalan Pukat 4, Mandala.', '<p>Update terbaru mengenai Acek Akhun umur 61 thn, yang ditemukan di pinggir jalan Pukat 4, Mandala.</p><p>Medan, 5 Feb‚Äô21, Pkl 10.30 Wib</p><p><br></p><p>Saat ini, Acek Akhun sudah ditanganin oleh Yayasan HOPE untuk penanganan kesehatannya.</p><p>No Pasien HOPE : 01.2020.001642</p><p><br></p><p>Sebelumnya pada 22 Desember‚Äô20. Yayasan HOPE sudah pernah membantu pengobatan acek ini yang di diagnosa : Stroke, Penyakit Jantung CHF dan Hipoalbumin.</p><p><br></p><p>Pada tanggal 3 Feb‚Äô21, Pkl 21.30 Wib, Acek ini dimasukkan Yayasan HOPE ke Klinik Mandala Medical Centre. Diagnosa awal : Demam, Nyeri Perut dan Lemah terutama Badan sebelah Kiri sulit di gerakkan. Dan ini akan dilanjutkan dengan cek lab.</p><p><br></p><p>Setelah Penanganan Awal dilalukan dan kondisi Acek sudah agak stabil, maka Yayasan HOPE ( dengan izin keluarga jauh ) akan serahkan ke BSS Foundation untuk selanjutnya dirawat di Kota Pematang Siantar dengan titip ke Panti Jompo disana.&nbsp;</p><p>Semua ini adalah solusi jangka panjang untuk rawat acek ini karena gak mungkin diserahkan ke keluarganya lagi, sudah beberapa kali diterlantarkan seperti ini.</p><p><br></p><p>Untuk info detail :</p><p>Yayasan HOPE, Samsudin Zhang 082361938185</p><p>BSS Foundation, Wartini Cen, 0811621857</p><p><br></p><p>Bagi Para Donatur Mulia yang mau bantu Yayasan HOPE untuk bayar biaya Perawatan Acek Akhun ini, maka bisa transfer ke :</p><p><br></p><p>YAYASAN HOPE</p><p>BANK BCA&nbsp;</p><p>A/c 7865998899</p><p><br></p><p>Terima kasih atas semua bantuannya.</p><p>Mohon bantuan sharenya.</p><p>Salam Sehat Selalu. üôè&nbsp;</p><p><br></p><p>Call Centre &amp; WhatsApp : 085211433338&nbsp;</p><p><br></p><p>Youtube : HOPE Foundation</p><p>https://bit.ly/HOPE_YT&nbsp;</p><p><br></p><p>Instagram : foundation_hope</p><p>https://bit.ly/HOPE_IG&nbsp;</p><p><br></p><p>Facebook : Hope (Yayasan Hope)</p><p>http://bit.ly/3c93KvU</p><p><br></p><p>Facebook Page : Yayasan HOPE</p><p>https://bit.ly/HOPE_FB&nbsp;</p><p><br></p><p>Facebook Group : Yayasan HOPE</p><p>https://bit.ly/HOPE_FBGroup&nbsp;</p><p><br></p><p>Salam Hangat,</p><p>Yayasan HOPE</p><p>( Yayasan Harapan Oasis Peduli Empati )</p><p><br></p><p>#fightcorona #fightingcovid19 #NewNormal #YayasanHOPE #HOPETeam #HOPEFoundation #HOPE #Harapan #JembatanHarapan #Healthy #Health #Sehat #Kesehatan #Charity #Sosial #BantuanKemanusiaan #Doctor #Dokter #DonorDarah #BloodDonation #GalangDana #BantuanSosial #BaktiSosial #Medan #SumateraUtara #Sumut #Indonesia #salamkemanusiaan #infodonordarah #ayodonordarah</p>', '/images/event/120210205115231.jpg', '2021-02-04 21:52:31', '2021-02-04 21:52:31'),
(5, 1, 'PENGGALANGAN DANA', 'Penggalangan Dana Bencana Alam di Kalimantan Selatan dan Sulawesi Barat', '<p><strong>Penggalangan Dana</strong></p><p><strong>Korban Bencana Banjir di Kalimantan Selatan</strong></p><p><strong>Korban Bencana Gempa di Kab. Majene dan Kab. Mamuju, Sulawesi Barat</strong></p><p><strong>Medan, 09 Februari‚Äô2020</strong></p><p><br></p><p>Note : Penggalangan Dana rencananya hanya dibuka 2 hari saja ( 9 &amp; 10 Februari‚Äô21 ).</p><p><br></p><p><strong>YAYASAN HOPE sebagai Organisasi Non Profit khusus di Bidang Kesehatan,</strong></p><p><strong>sangat prihatin dengan Perkembangan dari Kesehatan dan kondisi Para Warga yang terkena dampak :</strong></p><p><strong>- Bencana Banjir di Kalimantan Selatan.&nbsp;</strong></p><p><strong>&nbsp;Kejadian : 9 ‚Äì 15 January 2021. Ketinggian banjir bervariasi sampai 2 Meter.</strong></p><p><strong>- Korban Gempa 6,2 SR di Kab. Majene dan Kab. Mamuju, Sulawesi Barat.</strong></p><p><strong>&nbsp;Kejadian : 15 January 2021. Menelan korban jiwa +/- 90 Orang, Luka-Luka +/- 932 Orang, terdampak dan mengungsi 30.353 Orang dan 1.150 Rumah mengalami kerusakan.</strong></p><p><br></p><p>Dana yang terkumpul akan disalurkan melalui Pihak terkait.</p><p><br></p><p><strong>Untuk informasi lebih detail, silahkan hubungi :</strong></p><p><strong>Call Centre Yayasan HOPE : 085211433338</strong></p><p><br></p><p>Bantuan Dana, dapat ditransfer ke rekening :</p><p><strong>Bank BCA</strong></p><p><strong>A/n YAYASAN HOPE</strong></p><p><strong>A/c 7865998899</strong></p><p><br></p><p>Note : Kami minta maaf untuk Penggalangan Dana kali ini tidak menerima sumbangan berupa barang.&nbsp;</p><p><br></p><p><strong>Sebagian dari aktifitas Yayasan HOPE, akan update di Media Sosial :</strong></p><p><br></p><p><strong>Youtube : HOPE Foundation</strong></p><p><a href=\"https://bit.ly/HOPE_YT&nbsp;\" target=\"_blank\">https://bit.ly/HOPE_YT&nbsp;</a></p><p><br></p><p><strong>Instagram : foundation_hope</strong></p><p><a href=\"https://bit.ly/HOPE_IG&nbsp;\" target=\"_blank\">https://bit.ly/HOPE_IG&nbsp;</a></p><p><br></p><p><strong>Facebook : Hope (Yayasan Hope)</strong></p><p><a href=\"http://bit.ly/3c93KvU\" target=\"_blank\">http://bit.ly/3c93KvU</a></p><p><br></p><p><strong>Facebook Page : Yayasan HOPE</strong></p><p><a href=\"https://bit.ly/HOPE_FB\" target=\"_blank\">https://bit.ly/HOPE_FB</a>&nbsp;</p><p><br></p><p><strong>Facebook Group : Yayasan HOPE</strong></p><p><a href=\"https://bit.ly/HOPE_FBGroup\" target=\"_blank\">https://bit.ly/HOPE_FBGroup</a></p><p><br></p><p><strong>Terima Kasih atas semua kepedulian, doa dan bantuannya.</strong></p><p><strong>Semoga Semuanya selalu diberi Kesehatan yang baik, Bahagia dan Sukses selalu.</strong></p><p><strong>Amin.</strong></p><p><br></p><p>Mohon bantuan share nya.</p><p><br></p><p><strong>Salam,</strong></p><p><strong>Yayasan HOPE</strong></p><p><br></p><p>#fightcorona #fightingcovid19 #NewNormal #YayasanHOPE #HOPETeam #HOPEFoundation #HOPE #Harapan #JembatanHarapan #Healthy #Health #Sehat #Kesehatan #Charity #Sosial #Doctor #Dokter #DonorDarah #BloodDonation #GalangDana #BantuanSosial BaktiSosial #Medan #SumateraUtara #Sumut #Indonesia #salamkemanusiaan #infodonordarah #donordarahmedan #ayodonor</p>', '/images/event/120210209011647.jpg', '2021-02-08 23:16:47', '2021-02-08 23:16:47'),
