INSERT INTO `informasi_kesehatan` (`id_informasikesehatan`, `id`, `informasi_kesehatan_title`, `informasi_kesehatan_short_description`, `informasi_kesehatan_description`, `informasi_kesehatan_foto`, `created_at`, `updated_at`) VALUES
(1, 1, 'SUMBER KALSIUM', 'Kacang putih juga merupakan sumber kalsium yang baik, dengan satu cangkir (179 gram) kacang putih yang dimasak dapat memberikan 13 persen dari kebutuhan kalsium harian. Dari semua kacang-kacangan, almond termasuk yang tertinggi kalsium', '<p><span style=\"color: rgb(42, 42, 42);\">Manfaat kalsium selain untuk tulang dan gigi, di antaranya yakni: </span></p><ul><li><span style=\"color: rgb(42, 42, 42);\">Mengatur kontraksi otot </span></li><li><span style=\"color: rgb(42, 42, 42);\">Berperan penting dalam proses pembekuan darah </span></li><li><span style=\"color: rgb(42, 42, 42);\">Mencegah kanker usus besar </span></li><li><span style=\"color: rgb(42, 42, 42);\">Membantu perkembangan janin di dalam kandungan</span></li></ul><p><br></p><p><span style=\"color: rgb(42, 42, 42);\">Berikut ini setidaknya jumlah kebutuhan kalsium harian pada seseorang yang disesuikan berdasar kelompok usia dan jenis kelamin: </span></p><ul><li><span style=\"color: rgb(42, 42, 42);\">Anak-anak berusia 4-18 disarankan untuk mengonsumsi 1.300 mg kalsium per hari </span></li><li><span style=\"color: rgb(42, 42, 42);\">Orang dewasa disarankan untuk mengonsumsi 1.000 mg kalsium per hari </span></li><li><span style=\"color: rgb(42, 42, 42);\">Wanita usia 51-70 tahun disarankan untuk mengonsumsi 1.200 mg kalsium per hari </span></li><li><span style=\"color: rgb(42, 42, 42);\">Pria usia 51-70 tahun disarankan untuk mengonsumsi 1.000 mg kalsium per hari </span></li><li><span style=\"color: rgb(42, 42, 42);\">70 tahun ke atas disarankan untuk mengonsumsi 1.200 mg kalsium per hari</span></li></ul><p><br></p><p><br></p>', '/images/informasikesehatan/120201123121221.jpg', '2020-11-22 22:12:21', '2020-11-22 22:12:21');
