INSERT INTO `templates` (`id_templates`, `app_name`, `front_picture`, `profile_description`, `caption_front_picture`, `caption_description_front_picture`, `button_description_front_picture`, `about_us_description_footer`, `address_footer`, `number_phone_footer`, `email_footer`, `whatsapp`, `youtube`, `facebook`, `instagram`, `facebook_page`, `created_at`, `updated_at`) VALUES
(1, 'Yayasan HOPE', '/images/template/front_picture.jpg', '<p class=\"ql-align-justify\"><strong>Yayasan HOPE ( HOPE Team )</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>19 Juli 2012</strong></p><p class=\"ql-align-justify\">Telah terbentuk Organisasi Non Profit khusus di bidang kesehatan dengan nama HOPE Team yang merupakan singkatan dari Helping Other People\'s Expectation yang artinya membantu harapan orang lain.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>18 Januari 2018</strong></p><p class=\"ql-align-justify\">Organisasi HOPE Team secara resmi berubah nama menjadi Yayasan HOPE ( Yayasan Harapan Oasis Peduli Empati ) dengan harapan semakin meningkatkan pelayanan terhadap masyarakat di bidang kesehatan dan fokus pada penanganan penyebab dari akibat kesehatan yang terjadi. </p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>Visi Yayasan HOPE</strong></p><p class=\"ql-align-justify\">Menjadi Jembatan Harapan untuk membantu masyarakat di bidang kesehatan.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>Program Kerja Yayasan HOPE</strong></p><ul><li class=\"ql-align-justify\"> Seminar / Penyuluhan Kesehatan.</li><li class=\"ql-align-justify\"> Bakti Sosial Kesehatan Gratis. ( Umum, Gigi dan Spesialis )</li><li class=\"ql-align-justify\"> Bantuan Pengobatan untuk Pasien yang kurang mampu.</li><li class=\"ql-align-justify\"> Pembuatan Sumber Air Bersih.</li><li class=\"ql-align-justify\"> Donor Darah Sehat.</li><li class=\"ql-align-justify\"> Pembagian Kaca Mata Baca.</li><li class=\"ql-align-justify\"> Membuat Group Diskusi Kesehatan.</li><li class=\"ql-align-justify\"> Pembuatan Video Edukasi Kesehatan.</li><li class=\"ql-align-justify\"> etc.</li></ul><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>Yayasan HOPE membantu Para Pasien tanpa membedakan suku, status dan agama.</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Sejak 2012 hingga sekarang ( 23 Agustus 2019 ), jumlah pasien telah lebih dari 1.500 orang yang ditanganin secara langsung dan lebih dari 10.000 orang yang dibantu melalui Bakti Sosial Pengobatan Gratis. Termasuk sudah ribuan orang yang terbantu melalui Seminar Kesehatan, Donor Darah dan aktifitas amal lainnya.</p><p class=\"ql-align-justify\">Telat tercatat 70 kali mengadakan Bakti Sosial Pengobatan Gratis, Seminar Kesehatan dan Donor Darah diberbagai daerah di Provinsi Sumatera Utara.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Yayasan HOPE telah bekerja sama dengan puluhan Rumah Sakit dan Klinik di Kota Medan dan sekitarnya.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Bagi donatur mulia yang ingin turut bersumbangsih dalam misi kemanusian ini, dapat menyalurkan donasi melalui rekening resmi Yayasan HOPE, yaitu :</p><p class=\"ql-align-justify\"><strong>Bank BCA </strong></p><p class=\"ql-align-justify\"><strong>a/n YAYASAN HOPE</strong></p><p class=\"ql-align-justify\"><strong>a/c 7865998899</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">Terima kasih atas dukungan nya.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><strong>Salam,</strong></p><p class=\"ql-align-justify\"><strong>Pengurus Yayasan HOPE</strong></p>', 'YAYASAN HOPE', 'Under Construction \r\n( Waiting for Admin Input )', 'Daftar Vaksin', 'Yayasan HOPE adalah Organisasi Non Profit, khusus di Bidang Kesehatan.', 'Kantor : Jl. Jemadi, Kompleks Jemadi Indah No. A4, Pulo Brayan, Medan, Sumatera Utara, 20239', '0852 1143 3338', 'yayasan.hope@gmail.com', '085211433338', 'UCJbff5IdIHogiSK7BeO9cpw', '178897298909367', 'foundation_hope', 'https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2FYayasan.HOPE&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId=831338590303797', '2019-08-16 00:49:19', '2021-06-20 16:31:36');
